// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ShippingManagement {
    struct Shipping {
        uint256 productId;
        string origin;
        string destination;
        uint256 departureDate;
        uint256 expectedArrivalDate;
        string status;
    }

    mapping(uint256 => Shipping) public shipments;
    uint256 public shipmentCount = 0;

    // Events for shipping management
    event ShipmentAdded(
        uint256 indexed shipmentId,
        uint256 indexed productId,
        string origin,
        string destination,
        uint256 departureDate,
        uint256 expectedArrivalDate,
        string status
    );

    event ShipmentUpdated(
        uint256 indexed shipmentId,
        string newDestination,
        uint256 newDepartureDate,
        uint256 newExpectedArrivalDate,
        string newStatus
    );

    event ShipmentRemoved(uint256 indexed shipmentId);

    // Add a new shipment
    function addShipment(
        uint256 _shipmentId,
        uint256 _productId,
        string memory _origin,
        string memory _destination,
        uint256 _departureDate,
        uint256 _expectedArrivalDate,
        string memory _status
    ) public {
        require(
            bytes(shipments[_shipmentId].origin).length == 0,
            "Shipment already exists"
        );

        shipments[_shipmentId] = Shipping({
            productId: _productId,
            origin: _origin,
            destination: _destination,
            departureDate: _departureDate,
            expectedArrivalDate: _expectedArrivalDate,
            status: _status
        });

        shipmentCount++;
        emit ShipmentAdded(
            _shipmentId,
            _productId,
            _origin,
            _destination,
            _departureDate,
            _expectedArrivalDate,
            _status
        );
    }

    // Update the destination, dates, and status of a shipment
    function updateShipment(
        uint256 _shipmentId,
        string memory _newDestination,
        uint256 _newDepartureDate,
        uint256 _newExpectedArrivalDate,
        string memory _newStatus
    ) public {
        require(
            bytes(shipments[_shipmentId].origin).length != 0,
            "Shipment does not exist"
        );

        shipments[_shipmentId].destination = _newDestination;
        shipments[_shipmentId].departureDate = _newDepartureDate;
        shipments[_shipmentId].expectedArrivalDate = _newExpectedArrivalDate;
        shipments[_shipmentId].status = _newStatus;

        emit ShipmentUpdated(
            _shipmentId,
            _newDestination,
            _newDepartureDate,
            _newExpectedArrivalDate,
            _newStatus
        );
    }

    // Remove a shipment
    function removeShipment(uint256 _shipmentId) public {
        require(
            bytes(shipments[_shipmentId].origin).length != 0,
            "Shipment does not exist"
        );

        delete shipments[_shipmentId];
        shipmentCount--;

        emit ShipmentRemoved(_shipmentId);
    }

    // Get shipment details
    function getShipment(uint256 _shipmentId)
        public
        view
        returns (
            uint256,
            string memory,
            string memory,
            uint256,
            uint256,
            string memory
        )
    {
        require(
            bytes(shipments[_shipmentId].origin).length != 0,
            "Shipment does not exist"
        );

        Shipping memory shipment = shipments[_shipmentId];
        return (
            shipment.productId,
            shipment.origin,
            shipment.destination,
            shipment.departureDate,
            shipment.expectedArrivalDate,
            shipment.status
        );
    }
}

